import React, { Component } from "react";
import {
  StyleSheet,
  View,
  Image,
  Text,
  TouchableOpacity,
  ScrollView,
} from "react-native";
import ProductOptionBox from "./components/ProductOptionBox";
import { Feather, MaterialCommunityIcons } from "@expo/vector-icons";

function ProductList(props) {
  return (
    <View style={styles.container}>
      <View style={styles.imageStack}>
        <Image
          source={require("./assets/images/image_WLgS..png")}
          resizeMode="contain"
          style={styles.image}
        ></Image>
        <View style={styles.productSettingPage}>
          <View style={styles.topRow}>
            <Text style={styles.productManagementTxt}>Product Management</Text>
            <View style={styles.searchProductBox}></View>
            <TouchableOpacity style={styles.manageProductsBtn}>
              <MaterialCommunityIcons
                name="format-list-checks"
                style={styles.manageProductIcon}
              />
              <Text style={styles.manageProductsTxt}>Manage Products</Text>
            </TouchableOpacity>
          </View>
          <View style={styles.categoriesScrollView}>
            <ScrollView
              horizontal={true}
              contentContainerStyle={
                styles.categoriesScrollView_contentContainerStyle
              }
            >
              <Text style={styles.categoryOpt1Txt}>Combos</Text>
              <Text style={styles.categoryOpt2Txt}>Specialty</Text>
            </ScrollView>
          </View>
          <View style={styles.scrollArea}>
            <ScrollView
              horizontal={false}
              contentContainerStyle={styles.scrollArea_contentContainerStyle}
            >
              <View style={styles.productsMap}>
                <TouchableOpacity style={styles.addProductBtn}>
                  <Feather name="plus" style={styles.addProductPlusIcon} />
                  <Text style={styles.addNewItemTxt}>Add New Item</Text>
                </TouchableOpacity>
                <ProductOptionBox
                  style={styles.productOptionBox}
                ></ProductOptionBox>
                <ProductOptionBox
                  style={styles.productOptionBox1}
                ></ProductOptionBox>
                <ProductOptionBox
                  style={styles.productOptionBox2}
                ></ProductOptionBox>
                <ProductOptionBox
                  style={styles.productOptionBox3}
                ></ProductOptionBox>
              </View>
            </ScrollView>
          </View>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    width: 1440,
    height: 1025,
  },
  image: {
    position: "absolute",
    top: 0,
    left: 0,
    height: 1024,
    width: 1440,
  },
  productSettingPage: {
    top: 112,
    left: 278,
    width: 1123,
    height: 913,
    position: "absolute",
    backgroundColor: "#ffffff",
    shadowColor: "#d4d4d4",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 45,
    shadowOpacity: 1,
    shadowRadius: 15,
    alignItems: "center",
    justifyContent: "space-around",
  },
  topRow: {
    width: 1085,
    height: 38,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  productManagementTxt: {
    fontFamily: "roboto-700",
    color: "#121212",
    fontSize: 16,
  },
  searchProductBox: {
    width: 675,
    height: 34,
    backgroundColor: "#f6f6fb",
    borderWidth: 1,
    borderColor: "#000000",
    borderRadius: 10,
  },
  manageProductsBtn: {
    width: 181,
    height: 38,
    backgroundColor: "#fdfdff",
    borderWidth: 1,
    borderColor: "#000000",
    borderRadius: 10,
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-around",
  },
  manageProductIcon: {
    color: "rgba(0,0,0,1)",
    fontSize: 22,
  },
  manageProductsTxt: {
    fontFamily: "barlow-700",
    color: "#121212",
    fontSize: 14,
  },
  categoriesScrollView: {
    width: 980,
    height: 17,
  },
  categoriesScrollView_contentContainerStyle: {
    width: 980,
    height: 17,
  },
  categoryOpt1Txt: {
    fontFamily: "roboto-regular",
    color: "#121212",
  },
  categoryOpt2Txt: {
    fontFamily: "roboto-regular",
    color: "#121212",
    marginLeft: 100,
  },
  scrollArea: {
    width: 1123,
    height: 771,
  },
  scrollArea_contentContainerStyle: {
    height: 771,
    width: 1123,
    alignItems: "center",
  },
  productsMap: {
    width: 1081,
    height: 771,
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
  },
  addProductBtn: {
    width: 215,
    height: 285,
    borderWidth: 3,
    borderColor: "#858585",
    borderRadius: 10,
    borderStyle: "dashed",
    backgroundColor: "#f5f5f5",
    alignItems: "center",
    justifyContent: "center",
    marginRight: 0,
    marginBottom: 30,
  },
  addProductPlusIcon: {
    color: "rgba(0,0,0,1)",
    fontSize: 25,
  },
  addNewItemTxt: {
    fontFamily: "roboto-regular",
    color: "#121212",
    fontSize: 16,
    marginTop: 20,
  },
  productOptionBox: {
    height: 285,
    width: 215,
    marginLeft: 0,
    marginBottom: 30,
    marginRight: 30,
  },
  productOptionBox1: {
    height: 285,
    width: 215,
    marginRight: 30,
    marginLeft: 0,
    marginBottom: 30,
  },
  productOptionBox2: {
    height: 285,
    width: 215,
    marginLeft: 0,
    marginBottom: 30,
    marginRight: 30,
  },
  productOptionBox3: {
    height: 285,
    width: 215,
    marginLeft: 0,
    marginBottom: 30,
    marginRight: 30,
  },
  imageStack: {
    width: 1440,
    height: 1025,
  },
});

export default ProductList;
